/*  REQUIRED LIBRARIES  */
//tester to see if js is updated
const React = require("react"); 
import ReactDOM from "react-dom";
import io from "socket.io-client";
import { createStore } from "redux";
import { Provider } from "react-redux";
import {
    GamepadStatus,
    RobotStatus,
    AddGamepad,
    RemoveGamepad,
    State,
    Action,
    UpdateGamepadData,
    UpdateSensorData,
    UpdateRobotData,
    SensorStatus,
} from "./interfaces";
import App, { RobotStatusConnected, SensorsConnected } from "./App";

import {
    devToolsEnhancer,
    composeWithDevTools,
} from "redux-devtools-extension";

/**************************************************** */
import {app, BrowserWindow } from "electron";

function createWindow () {
  // Create the browser window.
  const win = new BrowserWindow({
    width: 800,
    height: 600,
    webPreferences: {
      nodeIntegration: true
    }
  })

  // and load the index.html of the app.
  win.loadFile('index.html')

  // Open the DevTools.
  win.webContents.openDevTools()
}

// This method will be called when Electron has finished
// initialization and is ready to create browser windows.
// Some APIs can only be used after this event occurs.
app.whenReady().then(createWindow)

// Quit when all windows are closed, except on macOS. There, it's common
// for applications and their menu bar to stay active until the user quits
// explicitly with Cmd + Q.
app.on('window-all-closed', () => {
  if (process.platform !== 'darwin') {
    app.quit()
  }
})

app.on('activate', () => {
  // On macOS it's common to re-create a window in the app when the
  // dock icon is clicked and there are no other windows open.
  if (BrowserWindow.getAllWindows().length === 0) {
    createWindow()
  }
})
/*************************************************** */

const initial_State: State = {
    robot: { connected: false, voltage: 0},
    gamepad: {
        connected: false,
        axes: { x: 0, y: 0, om: 0 },
        pressed: {
            start: false,
            stop: false,
            prev_start: false,
            prev_stop: false,
        },
        toggle: { start: false, stop: false },
    },
    sensors: {
        selection: { heartRate: false, temperature: false },
        values: { heartRate: 0, temperature: 0 },
    },
};

const store = createStore(reducer, composeWithDevTools());

const gamepadElement = document.getElementById("gamepadStatus");
ReactDOM.render(
    <Provider store={store}>
        <App />
    </Provider>,
    gamepadElement
);
const robotStatusElement = document.getElementById("robotStatus");
ReactDOM.render(
    <Provider store={store}>
        <RobotStatusConnected />
    </Provider>,
    robotStatusElement
);
const sensorElement = document.getElementById("sensorStatus");
ReactDOM.render(
    <Provider store={store}>
        <SensorsConnected />
    </Provider>,
    sensorElement
);
/*  SOCKET SETUP  */
const socket = io("http://localhost:3000/"); //Port for client

/*  GAMEPAD SETUP AND FUNCTIONS */
var haveEvents = "GamepadEvent" in window; //Other browsers
var haveWebkitEvents = "WebKitGamepadEvent" in window; //Chrome
const controllers: Gamepad[] = []; //List of gamepads

/*   SOCKET FUNCTIONS  */
//Log connections
//Handle connections
socket.on("connect", () => {
    console.log("Connected to server!");
    socket.send("Hello from client!");

    //Check for current data from sensors
    socket.on("sensorResponse", function (data: SensorStatus) {
        //TODO: Explicitly list the type
        console.log(data); //DO SOMETHING WITH THE DATA!
        store.dispatch(UpdateSensorData(data));
    });

    //Check for current data about robot
    socket.on("robotResponse", function (data: RobotStatus) {
        //TODO: Explicitly list the type
        console.log(data); //DO SOMETHING WITH THE DATA!
        store.dispatch(UpdateRobotData(data));
    });
});


//Log reconnect attempts
socket.on("reconnect", (e: number) => {
    console.log("Reconnected to server!");
    socket.send("Number of reconnects: " + e);
});

//Send all user inputs from gamepad to server
type SEND = () => void;
const sendGamepadStatus = (
    status: GamepadStatus,
    socket: SocketIOClient.Socket
): SEND => {
    console.log("Sending user inputs to server!");

    //Instance of IO type
    const send = () =>
        socket.emit("command", status);
    return send;
};



const requestSensorData = (socket: SocketIOClient.Socket): SEND => {
    //Instance of IO type
    const send = () => socket.emit("sensorRequest");
    return send;
};

const requestRobotData = (socket: SocketIOClient.Socket): SEND => {
    //Instance of IO type
    const send = () => socket.emit("robotRequest");
    return send;
};

//Interval at which data is sent to server
setInterval(() => {
    //Request sensor and robot data
    const x = requestSensorData(socket);
    const y = requestRobotData(socket);
    x(); y();

    //Request gamepads and update current data
    const gamepads = navigator.getGamepads();
    if (gamepads[0] === null) {
        console.log("no gamepad");
        return;
    }
    store.dispatch(UpdateGamepadData(gamepads[0])); //NOTE: Only using one gamepad currently
}, 33);
///////////////////////////////////////////////////////////////


/*       APP EVENT HANDLERS      */
//Redux dispatch store setup

//Subscribe to store to get state updates and send them to the server
//const unsubscribe = store.subscribe(() => console.log(store.getState()));
const unsubscribe = store.subscribe(() => {
    //Check if the socket is open
    if (socket.connected) {
        const x = sendGamepadStatus(store.getState().gamepad, socket); //Define the send function
        x(); //Run the send function
    }
});

//Event handler for adding gamepads
function addgamepad(gamepad: Gamepad) {
    //Dispatch the gamepad add action
    store.dispatch(AddGamepad(gamepad));
}

//addgamepad action creator, returns a Action
function AddGamepad(gamepad: Gamepad): AddGamepad {
    return { gamepad, type: "AddGamepad" };
}

//Event handler for removing gamepads
function removegamepad(gamepad: Gamepad) {
    store.dispatch(RemoveGamepad(gamepad));
}

//removegamepad action creator, returns a Action
function RemoveGamepad(gamepad: Gamepad): RemoveGamepad {
    return { gamepad, type: "RemoveGamepad" };
}

//sendgamepaddata action creator, returns a Action
function UpdateGamepadData(gamepad: Gamepad): UpdateGamepadData {
    return {
        axes: { x: gamepad.axes[0], y: gamepad.axes[1], om: gamepad.axes[2] },
        pressed: {
            prev_start: store.getState().gamepad.pressed.start,
            prev_stop: store.getState().gamepad.pressed.stop,
            start: gamepad.buttons[0].pressed,
            stop: gamepad.buttons[1].pressed,
        },
        toggle: {
            start: store.getState().gamepad.toggle.start,
            stop: store.getState().gamepad.toggle.stop,
        },
        type: "UpdateGamepadData",
    };
}

/* Makes the update sensor data action */
function UpdateSensorData(sensors: SensorStatus): UpdateSensorData {
    return {
        selection: {
            //fix how the sensor selection is retrieved
            heartRate: sensors.selection.heartRate,
            temperature: sensors.selection.temperature,
        },
        values: {
            heartRate: sensors.values.heartRate,
            temperature: sensors.values.temperature,
        },
        type: "UpdateSensorData",
    };
}

//update robot data action creator, returns a Action
function UpdateRobotData(robot: RobotStatus): UpdateRobotData {
    return {
        connected: robot.connected,
        voltage: robot.voltage,
        type: "UpdateRobotData",
    };
}


//Reduce the action that was dispatched
function reducer(state: State = initial_State, action: Action): State {
    if (action.type === "AddGamepad") {
        const newState: State = {
            ...state,
            gamepad: { ...state.gamepad, connected: true },
        };
        return newState;
    } else if (action.type === "RemoveGamepad") {
        const newState: State = {
            ...state,
            gamepad: { ...state.gamepad, connected: false },
        };
        return newState;
    } else if (action.type === "UpdateGamepadData") {
        const newState: State = {
            ...state,
            gamepad: {
                ...state.gamepad,
                axes: action.axes,
                pressed: action.pressed,
                toggle: {
                    start:
                        action.pressed.start === true &&
                        action.pressed.prev_start === false
                            ? !action.toggle.start
                            : action.toggle.start,
                    stop:
                        action.pressed.stop === true &&
                        action.pressed.prev_stop === false
                            ? !action.toggle.stop
                            : action.toggle.stop,
                },
            },
        };
        return newState;
    } else if (action.type === "UpdateSensorData") {
        const newState: State = {
            ...state,
            sensors: {
                ...state.sensors,
                values: {
                    heartRate: action.selection.heartRate
                        ? action.values.heartRate
                        : state.sensors.values.heartRate,
                    temperature: action.selection.temperature
                        ? action.values.temperature
                        : state.sensors.values.temperature,
                },
            },
        };
        return newState;
    } else if (action.type === "UpdateRobotData") {
        const newState: State = {
            ...state,
            robot: {
                ...state.gamepad,
                connected: action.connected,
                voltage: action.voltage
            },
        };
        return newState;
    }

    return state;
}
export default reducer;

/*    HANDLE USER EVENTS    */
function connecthandler(e: GamepadEvent) {
    addgamepad(e.gamepad);
}

function disconnecthandler(e: GamepadEvent) {
    removegamepad(e.gamepad);
    //unsubscribe();
}

//Handle all gamepad events using connection and disconneciton handlers or scan for new ones
if (haveEvents) {
    window.addEventListener("gamepadconnected", connecthandler as EventListener);
    window.addEventListener("gamepaddisconnected", disconnecthandler as EventListener);
} else if (haveWebkitEvents) {
    window.addEventListener("webkitgamepadconnected", connecthandler as EventListener);
    window.addEventListener("webkitgamepaddisconnected", disconnecthandler as EventListener);
} else {
    console.log("no events");
}
